{"strNational":null,"strProfessional":"","strInternational":"","strEvents":"<h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1810_%D0%B3%D0%BE%D0%B4\" title=\"1810 \u0433\u043e\u0434\">1810<\/a>&#160;\u2014 \u0431\u043b\u0438\u0437 \u043f\u043e\u0431\u0435\u0440\u0435\u0436\u044c\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F_(%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B2)\" title=\"\u0418\u0440\u043b\u0430\u043d\u0434\u0438\u044f (\u043e\u0441\u0442\u0440\u043e\u0432)\">\u0418\u0440\u043b\u0430\u043d\u0434\u0438\u0438<\/a> \u043f\u043e\u0442\u0435\u0440\u043f\u0435\u043b\u043e \u043a\u0440\u0443\u0448\u0435\u043d\u0438\u0435 \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u0448\u0442\u043e\u0440\u043c\u0430 \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u043e\u0435 \u0441\u0443\u0434\u043d\u043e <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%AD%D0%BB%D0%B8%D0%B7%D0%B0%D0%B1%D0%B5%D1%82_(%D1%81%D1%83%D0%B4%D0%BD%D0%BE)&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u042d\u043b\u0438\u0437\u0430\u0431\u0435\u0442 (\u0441\u0443\u0434\u043d\u043e) (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u00ab\u042d\u043b\u0438\u0437\u0430\u0431\u0435\u0442\u00bb<\/a> ; \u043f\u043e\u0433\u0438\u0431\u043b\u043e \u043e\u043a\u043e\u043b\u043e 400 \u0447\u0435\u043b\u043e\u0432\u0435\u043a .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1869\" class=\"mw-redirect\" title=\"1869\">1869<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B3%D0%B0%D0%B9%D0%BE\" title=\"\u041e\u0433\u0430\u0439\u043e\">\u041e\u0433\u0430\u0439\u043e<\/a> (\u0421\u0428\u0410) \u0423\u0438\u043b\u044c\u044f\u043c\u043e\u043c \u0421\u0435\u043c\u043f\u043b\u043e\u043c \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043d\u0430 \u043f\u0435\u0440\u0432\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%B5%D0%B2%D0%B0%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D1%80%D0%B5%D0%B7%D0%B8%D0%BD%D0%BA%D0%B0\" title=\"\u0416\u0435\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u0430\u044f \u0440\u0435\u0437\u0438\u043d\u043a\u0430\">\u0436\u0435\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u0430\u044f \u0440\u0435\u0437\u0438\u043d\u043a\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1895\" class=\"mw-redirect\" title=\"1895\">1895<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0418\u043d\u0434\u0438\u044f\">\u0438\u043d\u0434\u0438\u0439\u0441\u043a\u043e\u043c<\/a> \u0441\u0430\u043b\u043e\u043d\u0435 \u00ab\u0413\u0440\u0430\u043d\u0434-\u043a\u0430\u0444\u0435\u00bb \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D0%BB%D1%8C%D0%B2%D0%B0%D1%80_%D0%9A%D0%B0%D0%BF%D1%83%D1%86%D0%B8%D0%BD%D0%BE%D0%BA\" title=\"\u0411\u0443\u043b\u044c\u0432\u0430\u0440 \u041a\u0430\u043f\u0443\u0446\u0438\u043d\u043e\u043a\">\u0431\u0443\u043b\u044c\u0432\u0430\u0440\u0435 \u041a\u0430\u043f\u0443\u0446\u0438\u043d\u043e\u043a<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u044f<\/a>) \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0441\u044f \u043f\u0443\u0431\u043b\u0438\u0447\u043d\u044b\u0439 \u043f\u043e\u043a\u0430\u0437 \u00ab\u0421\u0438\u043d\u0435\u043c\u0430\u0442\u043e\u0433\u0440\u0430\u0444\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B0%D1%82%D1%8C%D1%8F_%D0%9B%D1%8E%D0%BC%D1%8C%D0%B5%D1%80\" title=\"\u0411\u0440\u0430\u0442\u044c\u044f \u041b\u044e\u043c\u044c\u0435\u0440\">\u0431\u0440\u0430\u0442\u044c\u0435\u0432 \u041b\u044e\u043c\u044c